<script>
export default {
  name: 'CommanderIcon',
  props: {
    isFilled: {
      type: Boolean,
      required: false,
      default: false
    },
    isUnableToBeFilled: {
      type: Boolean,
      required: false,
      default: false
    },
    height: {
      type: String,
      required: true
    },
    width: {
      type: String,
      required: true
    },
    addShadow: {
      type: Boolean,
      required: false,
      default: false
    },
    shadowColor: {
      type: String,
      required: false,
      default: 'blue'
    },
  },
  computed: {
    fillColor(){
      if(this.isUnableToBeFilled){
        return '#d9534f' // gray
      } else {
        return this.isFilled
        ? '#5cb85c' // success
        : '#84848c' //error
      }
    },
    styles(){
      return this.addShadow ? {
        filter: `drop-shadow(-1px 0 3px ${this.shadowColor})`
      } : null
    }
  }
}
